import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import Home from './Pages/home';

function App() {
  return (
    <div className="wrapper">
      <Router>

        <Switch>

          <Route exact path="/" component={Home} />

        </Switch>

      </Router>
    </div>
  );
}

export default App;
